:[{"id":"1052"}],"renderers":[{"id":"1070"}],"sizing_mode":"stretch_both","title":{"id":"1417"},"toolbar":{"id":"1061"},"x_range":{"id":"1040"},"x_scale":{"id":"1044"},"y_range":{"id":"1042"},"y_scale":{"id":"1046"}},"id":"1039","subtype":"Figure","type":"Plot"},{"attributes":{"coordinates":null,"formatter":{"id":"1447"},"group":null,"major_label_policy":{"id":"1448"},"ticker":{"id":"1167"}},"id":"1166","type":"CategoricalAxis"},{"attributes":{},"id":"1164","type":"CategoricalTicker"},{"attributes":{"dimensions":"width"},"id":"1302","type":"WheelZoomTool"},{"attributes":{"below":[{"id":"1226"}],"center":[{"id":"1229"},{"id":"1233"},{"id":"1247"}],"height":150,"left":[{"id":"1230"}],"renderers":[{"id":"1245"}],"sizing_mode":"stretch_both","title":{"id":"1217"},"toolbar":{"id":"1237"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1222"},"y_range":{"id":"1220"},"y_scale":{"id":"1224"}},"id":"1216","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1300","type":"ResetTool"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1396","type":"Line"},{"attributes":{},"id":"1525","type":"Selection"},{"attributes":{"children":[{"id":"1216"},{"id":"1249"},{"id":"1282"},{"id":"1368"}],"sizing_mode":"stretch_both"},"id":"1399","type":"Column"},{"attributes":{"dimensions":"width"},"id":"1301","type":"PanTool"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 10.02 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 60 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 1.69 s &lt;/li&gt;\n&lt;li&
